actionConfiguration.body:
() => {
		let icon = modal_ct_iicon.text; 
		let name = modal_ct_iname.text; 
		let desc = modal_ct_idesc.text; 
		let categories = modal_ct_icat.text.split(",").map((item) => item.trim(" ").replace(/^"|"$/g, "")); 
		let slug = modal_ct_islug.text; 
		let items = modal_ct_iitems.text.split(",").map((item) => ({value: item.trim(" ").replace(/^"|"$/g, "")}));
		return {
			icon: icon, name: name, description: desc, categories: categories, slug: slug, items: items
		}
	}

